import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sns
import uuid
import os

def boxplot(data: pd.DataFrame, columns: list[str], color: str, show_dots: bool):
    # Create a unique filename for the boxplot image
    filename = f"{uuid.uuid4()}.png"

    # Create the boxplot
    plt.figure(figsize=(10, 6))
    sns.boxplot(data=data[columns], color=color)

    if show_dots:
        sns.stripplot(data=data[columns], color='black', alpha=0.5, jitter=True)

    # Save the plot to a file
    plt.savefig(filename)
    plt.close()

    return {
        "outputs": [
            {
                "data": data,
                "chart_images": [
                    {
                        "path": filename,
                    },
                ],
            },
        ],
    }
